// 导入axios实例
import service from '@/request/index'
// get请求用params,post请求用data
//导出api方法
export function shopAdd(param) {
    return service({
        url: '127.0.0.1:8083',
        method: 'get',
        params: param,
    })
}

export const  GetPosts = () => service().get('/hello')

export const GetsearchData = (params) => service().get('/list',{params})

export const PostPosts = (params) => service().post('posts',params)
